emote branch names","#    *) local and remote tag names","#    *) .git/remotes file names","#    *) git 'subcommands'","#    *) git email aliases for git-send-email","#    *) tree paths within 'ref:path/to/file' expressions","#    *) file paths within current working directory and index","#    *) common --long-options","#","# To use these routines:","#","#    1) Copy this file to somewhere (e.g. ~/.git-completion.bash).","#    2) Add the following line to your .bashrc/.zshrc:","#        source ~/.git-completion.bash","#    3) Consider changing your PS1 to also show the current branch,","#       see git-prompt.sh for details.","#","# If you use complex aliases of form '!f() { ... }; f', you can use the null","# command ':' as the first command in the function body to declare the desired","# completion style.  For example '!f() { : git commit ; ... }; f' will","# tell the completion to use commit completion.  This also works with aliases","# of form \"!sh -c '...'\".  For example, \"!sh -c ': git commit ; ... '\".","# Note that \"git\" is optional --- '!f() { : commit; ...}; f' would complete","# just like the 'git commit' command.","#","# To add completion for git subcommands that are implemented in external","# scripts, define a function of the form '_git_${subcommand}' while replacing","# all dashes with underscores, and the main git completion will make use of it.","# For example, to add completion for 'git do-stuff' (which could e.g. live","# in /usr/bin/git-do-stuff), name the completion function '_git_do_stuff'.","# See _git_show, _git_bisect etc. below for more examples.","#","# If you have a shell command that is not part of git (and is not called as a","# git subcommand), but you would still like git-style completion for it, use","# __git_complete. For example, to use the same completion as for 'git log' also","# for the 'gl' command:","#","#   __git_complete gl git_log","#","# Or if the 'gk' command should be completed the same as 'gitk':","#","#   __git_complete gk gitk","#","# The second parameter of __git_complete gives the completion function; it is","# resolved as a function named \"$2\", or \"__$2_main\", or \"_$2\" in that order.","# In the examples above, the actual functions used for completion will be","# _git_log and __gitk_main.","#","# Compatible with bash 3.2.57.","#","# You can set the following environment variables to influence the behavior of","# the completion routines:","#","#   GIT_COMPLETION_CHECKOUT_NO_GUESS","#","#     When set to \"1\", do not include \"DWIM\" suggestions in git-checkout","#     and git-switch completion (e.g., completing \"foo\" when \"origin/foo\"","#     exists).","#","#   GIT_COMPLETION_SHOW_ALL_COMMANDS","#","#     When set to \"1\" suggest all commands, including plumbing commands","#     which are hidden by default (e.g. \"cat-file\" on \"git ca\u003cTAB\u003e\").","#","#   GIT_COMPLETION_SHOW_ALL","#","#     When set to \"1\" suggest all options, including options which are","#     typically hidden (e.g. '--allow-empty' for 'git commit').","#","#   GIT_COMPLETION_IGNORE_CASE","#","#     When set, uses for-each-ref '--ignore-case' to find refs that match","#     case insensitively, even on systems with case sensitive file systems","#     (e.g., completing tag name \"FOO\" on \"git checkout f\u003cTAB\u003e\").","","case \"$COMP_WORDBREAKS\" in","*:*) : great ;;","*)   COMP_WORDBREAKS=\"$COMP_WORDBREAKS:\"","esac","","# Discovers the path to the git repository taking any '--git-dir=\u003cpath\u003e' and","# '-C \u003cpath\u003e' options into account and stores it in the $__git_repo_path","# variable.","__git_find_repo_path ()","{","\tif [ -n \"${__git_repo_path-}\" ]; then","\t\t# we already know where it is","\t\treturn","\tfi","","\tif [ -n \"${__git_C_args-}\" ]; then","\t\t__git_repo_path=\"$(git \"${__git_C_args[@]}\" \\","\t\t\t${__git_dir:+--git-dir=\"$__git_dir\"} \\","\t\t\trev-parse --absolute-git-dir 2\u003e/dev/null)\"","\telif [ -n \"${__git_dir-}\" ]; then","\t\ttest -d \"$__git_dir\" \u0026\u0026","\t\t__git_repo_path=\"$__git_dir\"","\telif [ -n \"${GIT_DIR-}\" ]; then","\t\ttest -d \"$GIT_DIR\" \u0026\u0026","\t\t__git_repo_path=\"$GIT_DIR\"","\telif [ -d .git ]; then","\t\t__git_repo_path=.git","\telse","\t\t__git_repo_path=\"$(git rev-parse --git-dir 2\u003e/dev/null)\"","\tfi","}","","# Deprecated: use __git_find_repo_path() and $__git_repo_path instead","# __gitdir accepts 0 or 1 arguments (i.e., location)","# returns location of .git repo","__gitdir ()","{","\tif [ -z \"${1-}\" ]; then","\t\t__git_find_repo_path || return 1","\t\techo \"$__git_repo_path\"","\telif [ -d \"$1/.git\" ]; then","\t\techo \"$1/.git\"","\telse","\t\techo \"$1\"","\tfi","}","","# Runs git with all the options given as argument, respecting any","# '--git-dir=\u003cpath\u003e' and '-C \u003cpath\u003e' options present on the command line","__git ()","{","\tgit ${__git_C_args:+\"${__git_C_args[@]}\"} \\","\t\t${__git_dir:+--git-dir=\"$__git_dir\"} \"$@\" 2\u003e/dev/null","}","","# Helper function to read the first line of a file into a variable.","# __git_eread requires 2 arguments, the file path and the name of the","# variable, in that order.","#","# This is taken from git-prompt.sh.","__git_eread ()","{","\ttest -r \"$1\" \u0026\u0026 IFS=$'\\r\\n' read -r \"$2\" \u003c\"$1\"","}","","# Runs git in $__git_repo_path to determine whether a pseudoref exists.","# 1: The pseudo-ref to search","__git_pseudoref_exists ()","{","\tlocal ref=$1","\tlocal head","","\t__git_find_repo_path","","\t# If the reftable is in use, we have to shell out to 'git rev-parse'","\t# to determine whether the ref exists instead of looking directly in","\t# the filesystem to determine whether the ref exists. Otherwise, use","\t# Bash builtins since executing Git commands are expensive on some","\t# platforms.","\tif __git_eread \"$__git_repo_path/HEAD\" head; then","\t\tif [ \"$head\" == \"ref: refs/heads/.invalid\" ]; then","\t\t\t__git show-ref --exists \"$ref\"","\t\t\treturn $?","\t\tfi","\tfi","","\t[ -f \"$__git_repo_path/$ref\" ]","}","","# Removes backslash escaping, single quotes and double quotes from a word,","# stores the result in the variable $dequoted_word.","# 1: The word to dequote.","__git_dequote ()","{","\tlocal rest=\"$1\" len ch","","\tdequoted_word=\"\"","","\twhile test -n \"$rest\"; do","\t\tlen=${#dequoted_word}","\t\tdequoted_word=\"$dequoted_word${rest%%[\\\\\\'\\\"]*}\"","\t\trest=\"${rest:$((${#dequoted_word}-$len))}\"","","\t\tcase \"${rest:0:1}\" in","\t\t\\\\)","\t\t\tch=\"${rest:1:1}\"","\t\t\tcase \"$ch\" in","\t\t\t$'\\n')","\t\t\t\t;;","\t\t\t*)","\t\t\t\tdequoted_word=\"$dequoted_word$ch\"","\t\t\t\t;;","\t\t\tesac","\t\t\trest=\"${rest:2}\"","\t\t\t;;","\t\t\\')","\t\t\trest=\"${rest:1}\"","\t\t\tlen=${#dequoted_word}","\t\t\tdequoted_word=\"$dequoted_word${rest%%\\'*}\"","\t\t\trest=\"${rest:$((${#dequoted_word}-$len+1))}\"","\t\t\t;;","\t\t\\\")","\t\t\trest=\"${rest:1}\"","\t\t\twhile test -n \"$rest\" ; do","\t\t\t\tlen=${#dequoted_word}","\t\t\t\tdequoted_word=\"$dequoted_word${rest%%[\\\\\\\"]*}\"","\t\t\t\trest=\"${rest:$((${#dequoted_word}-$len))}\"","\t\t\t\tcase \"${rest:0:1}\" in","\t\t\t\t\\\\)","\t\t\t\t\tch=\"${rest:1:1}\"","\t\t\t\t\tcase \"$ch\" in","\t\t\t\t\t\\\"|\\\\|\\$|\\`)","\t\t\t\t\t\tdequoted_word=\"$dequoted_word$ch\"","\t\t\t\t\t\t;;","\t\t\t\t\t$'\\n')","\t\t\t\t\t\t;;","\t\t\t\t\t*)","\t\t\t\t\t\tdequoted_word=\"$dequoted_word\\\\$ch\"","\t\t\t\t\t\t;;","\t\t\t\t\tesac","\t\t\t\t\trest=\"${rest:2}\"","\t\t\t\t\t;;","\t\t\t\t\\\")","\t\t\t\t\trest=\"${rest:1}\"","\t\t\t\t\tbreak","\t\t\t\t\t;;","\t\t\t\tesac","\t\t\tdone","\t\t\t;;","\t\tesac","\tdone","}","","# The following function is based on code from:","#","#   bash_completion - programmable completion functions for bash 3.2+","#","#   Copyright © 2006-2008, Ian Macdonald \u003cian@caliban.org\u003e","#             © 2009-2010, Bash Completion Maintainers","#                     \u003cbash-completion-