"# 3: Generate possible completion matches for this word (optional).","__gitcomp_file ()","{","\tlocal IFS=$'\\n'","","\t# XXX does not work when the directory prefix contains a tilde,","\t# since tilde expansion is not applied.","\t# This means that COMPREPLY will be empty and Bash default","\t# completion will be used.","\t__gitcompadd \"$1\" \"${2-}\" \"${3-$cur}\" \"\"","","\t# use a hack to enable file mode in bash \u003c 4","\tcompopt -o filenames +o nospace 2\u003e/dev/null ||","\tcompgen -f /non-existing-dir/ \u003e/dev/null ||","\ttrue","}","","# Find the current subcommand for commands that follow the syntax:","#","#    git \u003ccommand\u003e \u003csubcommand\u003e","#","# 1: List of possible subcommands.","# 2: Optional subcommand to return when none is found.","__git_find_subcommand ()","{","\tlocal subcommand subcommands=\"$1\" default_subcommand=\"$2\"","","\tfor subcommand in $subcommands; do","\t\tif [ \"$subcommand\" = \"${words[__git_cmd_idx+1]}\" ]; then","\t\t\techo $subcommand","\t\t\treturn","\t\tfi","\tdone","","\techo $default_subcommand","}","","# Execute 'git ls-files', unless the --committable option is specified, in","# which case it runs 'git diff-index' to find out the files that can be","# committed.  It return paths relative to the directory specified in the first","# argument, and using the options specified in the second argument.","__git_ls_files_helper ()","{","\tif [ \"$2\" = \"--committable\" ]; then","\t\t__git -C \"$1\" -c core.quotePath=false diff-index \\","\t\t\t--name-only --relative HEAD -- \"${3//\\\\/\\\\\\\\}*\"","\telse","\t\t# NOTE: $2 is not quoted in order to support multiple options","\t\t__git -C \"$1\" -c core.quotePath=false ls-files \\","\t\t\t--exclude-standard $2 -- \"${3//\\\\/\\\\\\\\}*\"","\tfi","}","","","# __git_index_files accepts 1 or 2 arguments:","# 1: Options to pass to ls-files (required).","# 2: A directory path (optional).","#    If provided, only files within the specified directory are listed