ndling unusual characters.","\twhile IFS= read -r -d $'\\0' c ; do","\t\t# If there are directory completions, find ones that start","\t\t# with \"$cur\", the current token, and put those in COMPREPLY","\t\tif [[ $c == \"$cur\"* ]]; then","\t\t\tCOMPREPLY+=(\"$c/\")","\t\t\t_found=1","\t\tfi","\tdone \u003c \u003c(__git ls-tree -z -d --name-only HEAD $_tmp_dir)","","\tif [[ $_found == 0 ]] \u0026\u0026 [[ \"$cur\" =~ /$ ]]; then","\t\t# No possible further completions any deeper, so assume we're at","\t\t# a leaf directory and just consider it complete","\t\t__gitcomp_direct_append \"$cur \"","\telif [[ $_found == 0 ]]; then","\t\t# No possible completions found.  Avoid falling back to","\t\t# bash's default file and directory completion, because all","\t\t# valid completions have already been searched and the","\t\t# fallbacks can do nothing but mislead.  In fact, they can","\t\t# mislead in three different ways:","\t\t#    1) Fallback file completion makes no sense when asking","\t\t#       for directory completions, as this function does.","\t\t#    2) Fallback directory completion is bad because","\t\t#       e.g. \"/pro\" is invalid and should NOT complete to","\t\t#       \"/proc\".","\t\t#    3) Fallback file/directory completion only completes","\t\t#       on paths that exist in the current working tree,","\t\t#       i.e. which are *already* part of their","\t\t#       sparse-checkout.  Thus, normal file and directory","\t\t#       completion is always useless for \"git","\t\t#       sparse-checkout add\" and is also problematic for","\t\t#       \"git sparse-checkout set\" unless using it to","\t\t#       strictly narrow the checkout.","\t\tCOMPREPLY=( \"\" )","\tfi","}","","# In non-cone mode, the arguments to {set,add} are supposed to be","# patterns, relative to the toplevel directory.  These can be any kind","# of general pattern, like 'subdir/*.c' and we can't complete on all","# of those.  However, if the user presses Tab to get tab completion, we","# presume that they are trying to provide a pattern that names a specific","# path.","__gitcomp_slash_leading_paths ()","{","\tlocal dequoted_word pfx=\"\" cur_ toplevel","","\t# Since we are dealing with a sparse-checkout, subdirectories may not","\t# exist in the local working copy.  Therefore, we want to run all","\t# ls-files commands relative to the repository toplevel.","\ttoplevel=\"$(git rev-parse --show-toplevel)/\"","","\t__git_dequote \"$cur\"","","\t# If the paths provided by the user already start with '/', then","\t# they are considered relative to the toplevel of the repository","\t# already.  If they do not start with /, then we need to adjust","\t# them to start with the appropriate prefix.","\tcase \"$cur\" in","\t/*)","\t\tcur=\"${cur:1}\"","\t\t;;","\t*)","\t\tpfx=\"$(__git rev-parse --show-prefix)\"","\tesac","","\t# Since sparse-index is limited to cone-mode, in non-cone-mode the","\t# list of valid paths is precisely the cached files in the index.","\t#","\t# NEEDSWORK:","\t#   1) We probably need to take care of cases where ls-files","\t#      responds with special quoting.","\t#   2) We probably need to take care of cases where ${cur} has","\t#      some kind of special quoting.","\t#   3) On top of any quoting from 1 \u0026 2, we have to provide an extra","\t#      level of quoting for any paths that contain a '*', '?', '\\',","\t#      '[', ']', or leading '#' or '!' since those will be","\t#      interpreted by sparse-checkout as something other than a","\t#      literal path character.","\t# Since there are two types of quoting here, this might get really","\t# complex.  For now, just punt on all of this...","\tcompletions=\"$(__git -C \"${toplevel}\" -c core.quotePath=false \\","\t\t\t ls-files --cached -- \"${pfx}${cur}*\" \\","\t\t\t | sed -e s%^%/% -e 's%$% %')\"","\t# Note, above, though that we needed all of the completions to be","\t# prefixed with a '/', and we want to add a space so that bash","\t# completion will actually complete an entry and let us move on to","\t# the next one.","","\t# Return what we've found.","\tif test -n \"$completions\"; then","\t\t# We found some completions; return them","\t\tlocal IFS=$'\\n'","\t\tCOMPREPLY=($completions)","\telse","\t\t# Do NOT fall back to bash-style all-local-files-and-dirs","\t\t# when we find no match.  Such options are worse than","\t\t# useless:","\t\t#     1. \"git sparse-checkout add\" needs paths that are NOT","\t\t#        currently in the working copy.  \"git","\t\t#        sparse-checkout set\" does as well, except in the","\t\t#        special cases when users are only trying to narrow","\t\t#        their sparse checkout to a subset of what they","\t\t#        already have.","\t\t#","\t\t#     2. A path like '.config' is ambiguous as to whether","\t\t#        the user wants all '.config' files throughout the","\t\t#        tree, or just the one under the current directory.","\t\t#        It would result in a warning from the","\t\t#        sparse-checkout command due to this.  As such, all","\t\t#        completions of paths should be prefixed with a","\t\t#        '/'.","\t\t#","\t\t#     3. We don't want paths prefixed with a '/' to","\t\t#        complete files in the system root directory, we","\t\t#        want it to complete on files relative to the","\t\t#        repository root.","\t\t#","\t\t# As such, make sure that NO completions are offered rather","\t\t# than falling back to bash's default completions.","\t\tCOMPREPLY=( \"\" )","\tfi","}","","_git_sparse_checkout ()","{","\tlocal subcommands=\"list init set disable add reapply\"","\tlocal subcommand=\"$(__git_find_on_cmdline \"$subcommands\")\"","\tlocal using_cone=true","\tif [ -z \"$subcommand\" ]; then","\t\t__gitcomp \"$subcommands\"","\t\treturn","\tfi","","\tcase \"$subcommand,$cur\" in","\t*,--*)","\t\t__gitcomp_builtin sparse-checkout_$subcommand \"\" \"--\"","\t\t;;","\tset,*|add,*)","\t\tif [[ \"$(__git config core.sparseCheckout)\" == \"true\" \u0026\u00